pragma solidity ^0.8.1;

contract SecondVulnerableToken {
  uint256 private _totalSupply = 1000000;
  mapping (address => uint256) private _balances;

  constructor() public {
    _balances[msg.sender] = 100000;
  }

  function balanceOf(address _owner) external view returns (uint256) {
    return _balances[_owner];
  }

  function transfer(address _to, uint256 _value) external returns (bool) {
    address from = msg.sender;
    uint256 newBalanceFrom = _balances[from] - _value;
    uint256 newBalanceTo = _balances[_to] + _value;
    _balances[from] = newBalanceFrom;
    _balances[_to] = newBalanceTo;
    return false;
  }
}

